import React from "react";
import "./detail.css";
import { useLocation } from 'react-router-dom';

const Detail = () => {
  const location = useLocation();
  const data = location.state.data;

  return(
    <div>
      <h3>Detail Page</h3>
      <h4>Information about {data.name}</h4>
      <p className="item-label">Name: <span className="value">{data.name}</span></p>
      <p className="item-label">PhoneNumber: <span className="value">{data.phonenumber}</span></p>
      <p className="item-label">Birthday: <span className="value">{data.birthday}</span></p>
      <p className="item-label">Relation: <span className="value">{data.relation}</span></p>
      <p className="item-label">Nationality: <span className="value">{data.nationality}</span></p>
      <p className="item-label">City: <span className="value">{data.city}</span></p>
    </div>
  );
}

export default Detail;
